import './Table.css';
import Song from './Song.js';
import { useState } from 'react';
import { Link, browserRouter, Route, Routes } from 'react-router-dom'

function TableNavBar() {
    const [isSongsGreen, setIsSongsGreen] = useState(true);

    const handleSongsClick = () => {
        if (!isSongsGreen) {
            setIsSongsGreen(true);
        }
    };

    const handleArtistsClick = () => {
        if (isSongsGreen) {
            setIsSongsGreen(false);
        }
    };

    return (
        <div className='table'>
            <link rel="stylesheet" href="https://use.typekit.net/lll4eml.css"></link>
            <div className='tableNavBar'>
                <div className='tableNavBarCategory'>
                    <div className='tableNavBarItem' style={{ backgroundColor: isSongsGreen ? 'green' : 'red' }} onClick={handleSongsClick}>Songs</div>
                    <div className='tableNavBarItem' style={{ backgroundColor: isSongsGreen ? 'red' : 'green' }} onClick={handleArtistsClick}> Artists</div>
                </div>
                <div className='dash'>
                    -
                </div>
                <div className='tableNavBarCategory'>
                    <div className='tableNavBarItem' >Month</div>
                    <div className='tableNavBarItem'>6 Months</div>
                    <div className='tableNavBarItem'>All Time</div>
                </div>
            </div>
        </div >
    );
}

export default TableNavBar;
